  false,\n\t\"url\": null,\n\t\"notes\": \"This GIS shapefile data illustrates the
  regional roadways included in the Louisiana Speaks community growth option of compact
  development (Option C). This network accommodates a land use pattern focused on
  fixed transit corridors linking regional and subregional centers. The routes are
  based on data from the Louisiana State Department of Transportation and Development
  (DOTD) Statewide Transportation Plan. Projects include transportation investments
  identified in the Statewide Transportation Improvement Program (STIP) and projects
  from local Metropolitan Planning Organization Master Transportation Plans (MTP).
  The Louisiana Speaks Regional Plan process study area includes the 35 southernmost
  parishes of Louisiana.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
